import React, {useState, useEffect} from 'react';
import ReturnCarousel from './ReturnCarousel'
import {Card, CardDeck, Carousel} from 'react-bootstrap';

function ReadBlogList(props) {

	let title = props.title;
	let desc = props.desc;
	let writer = props.writer;
	let imagePathArray = props.imagePathArray;
	let keyNumber =-1;

	return(
		<div>
			<CardDeck>
			<Card>
			<Carousel>
				{
					imagePathArray.map((data)=>{
						console.log(data);
						keyNumber = keyNumber+1;
						return(
							<Carousel.Item key = {keyNumber} interval={null}>
								<img								
								className=""
								src={require(`${data}`)}
								alt='BlogImages'
								/>
							</Carousel.Item>
						)
	
					})
				}
			</Carousel>	
				<Card.Body>
				<Card.Title>{title}</Card.Title>
				<Card.Text>
						{desc}
				</Card.Text>
				</Card.Body>
				<Card.Footer>
					<small className="text-muted">writer:{writer}</small>
				</Card.Footer>
			</Card>
			</CardDeck>
			</div>
	);
}

export default ReadBlogList;
